import React from "react";


const Recipe= ({id, name,diets,image})=>{
    return (
        <div>
            {
            <ul>
                <p>{id}</p>
                <p>{name}</p>
                <p>{diets}</p>
                <p>{image}</p>
            </ul>

            }
        </div>
    )
}

export default Recipe;
